#Handles calculation for a node in a layer of 32 nodes with 128 inputs
def node128_32(inputs, weights):
    temp = 0
    for i in range(128):
        temp += inputs[i] * weights[i]
    if (temp < 0):
        return 0
    return temp


# Handle the processing of layer of 32 nodes with 128 inputs
def layer128_32(inputs, weights):
    output = [ 0 for i in range(32)]
    for i in range(32):
        output[i] = node128_32(inputs, weights[i])
    return output


